<script>
export default {
  // 
  // + likes; +date
  // + asong+
  props: {
    songimg: {
      type: String,
      required: true,
      default: 'https://picsum.photos/100'
    },
    asong: {
      type: Boolean,
      required: false,
      default: false
    },
    titles: {
      type: String,
      required: true,
      default: ''
    },
    author: {
      type: String,
      required: true,
      default: ''
    },
    likes: {
      type: Boolean,
      required: false,
      default: false
    },
    date: {
      type: Boolean,
      required: false,
      default: false
    },
    albumname: {
      type: String,
      required: true,
      default: ''
    },
    years: {
      type: Number,
      required: true,
      default: 2020
    },
    songnum: {
      type: Number,
      required: true,
      default: 12
    },
    times: {
      type: String,
      required: true,
      default: '00:51:03'
    }
  },
  data () {
    return {
      turnOn: 'off',
      playPause: require('../assets/icon/play.svg'),
      likeRed: false
    }
  },
  methods: {
    playFun () {
      if (this.turnOn === 'off') {
        this.turnOn = 'on'
        this.playPause = require('../assets/icon/pause.svg')
      } else if (this.turnOn === 'on') {
        this.turnOn = 'off'
        this.playPause = require('../assets/icon/play.svg')
      }
    },
    actionFun () {
      this.likeRed = !this.likeRed
      console.log(this.likeRed)
    }
  },
  mounted () {
  }
}

